import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchWktData, selectWktData, selectHasFetched } from "../store/wktSlice";
import Modal from "./Modal";

const FeatureTable = () => {
  const dispatch = useDispatch();
  const wktData = useSelector((state) => state.wkt.data);
  const hasFetched = useSelector(selectHasFetched);

  useEffect(() => {
    if (!hasFetched) {
      dispatch(fetchWktData());
    }
  }, [dispatch, hasFetched]);

  return (
    <Modal>
      <div>
      <h1>WKT Data</h1>
      {wktData ?? (
        <ul>
          {wktData.map((item) => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      ) }
    </div>
    </Modal>
  );
};

export default FeatureTable;
